    const getAllExercises = () => {
        fetch("https://localhost:3000/api/v1/exercises")
            .then(response => response.json)
            .then(data => setAllExercises(data))
    }

    return (
        <>
        <p>NavBar</p> 
        <p>New Workout Page</p>
        {/* <ExerciseDropdownSearch allExercises = {allExercises}/> */}
        <ExerciseList/>
        </>
    )
}
